import React from 'react';
import NavBar from './NavBar';
import pic from '../pictures/IMG_0041.jpg';

const Home = () => {

  return (
    <>
      <div className="home">
        <img src={pic} alt="Logo" className="pic"/>
        <h1>Welcome to the Home Page</h1>
        <p>This is the home page of the website. This is where you can find the information you need to get started.</p>
      </div>



    </>
  );
}

export default Home;
